import React,{useState} from 'react'

import {firabaseInitApp, firebaseInitApp} from '../base'


export default class AdminUpload extends React.Component {

    state={
        url2:''
    }
    
    onChange=(e)=>{
        const file= e.target.files[0]
        const storageRef=firebaseInitApp.storage().ref()
        const  fileRef=storageRef.child('video/'+file.name)
        fileRef.put(file).then(()=>{
            console.log("Upload a file");
             fileRef.getDownloadURL().then(function (url) {
                 console.log(url)
                 this.setState({url2:url})
             });
        })

        
    }
    render(){
        return (
            <div>
                <input type="file" onChange={this.onChange}/>
                <video controls>
                        <source src={this.state.url2}
                        type="video/mp4"></source>
                </video>
            </div>
        )
     }
}
